import styled from "styled-components";
import { colors } from "../locales/colors";

export const ListHandleBox = styled.button`
  background-color: ${colors.bg};
  border: 1px solid ${colors.buttonbg};
  width: 70%;
  height: 100px;
  border-width: 0px 1px 1px 0px;
`;
